def find_indexes_with_one(arrays):
    # Initialize a list of 64 zeros to track the presence of 1s at each index
    combined = [0] * 64

    # Iterate through each array
    for array in arrays:
        # Perform an element-wise OR to track indexes with at least one 1
        combined = [c | a for c, a in zip(combined, array)]

    # Find the indexes where there's at least one 1
    indexes_with_one = [index for index, value in enumerate(combined) if value == 1]

    return indexes_with_one

